import { createRouter, createWebHistory } from "vue-router";
import HomeView from "../components/testInterface.vue"; // Assurez-vous que cette vue existe
// import Login from "@/components/LoginForm.vue";
const routes = [
  {
    path: "/",
    name: "home",
    component: HomeView,
  },
  // {
  //   path: "/login",
  //   name: "login",
  //   component: Login, // Exemple d'import asynchrone pour la page login
  // },
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes,
});

export default router;
